"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Malaria (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H71683739\">",
"      <span class=\"h1\">",
"       What is malaria?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Malaria is a disease caused by an infection with a parasite (a type of germ). Mosquitoes carry the parasite and spread it to people by biting them. &nbsp; &nbsp;",
"     </p>",
"     <p>",
"      Malaria is common in many countries. It can be mild or severe. Severe malaria can cause serious health problems and even death.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683754\">",
"      <span class=\"h1\">",
"       What are the symptoms of malaria?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Chills",
"       </li>",
"       <li>",
"        Sweating",
"       </li>",
"       <li>",
"        Headaches",
"       </li>",
"       <li>",
"        Body aches",
"       </li>",
"       <li>",
"        Tiredness",
"       </li>",
"       <li>",
"        Stomach problems &ndash; These can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Loss of appetite",
"       </li>",
"       <li>",
"        Nausea and vomiting",
"       </li>",
"       <li>",
"        Belly pain",
"       </li>",
"       <li>",
"        Diarrhea",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Skin that looks yellow &ndash; This is called &ldquo;jaundice.&rdquo;",
"       </li>",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Fast heart rate or breathing",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Severe malaria can cause other symptoms, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Confusion",
"       </li>",
"       <li>",
"        Seeing or hearing things that are not really there",
"       </li>",
"       <li>",
"        Seizures",
"       </li>",
"       <li>",
"        Dark or bloody urine &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683769\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse right away if you get a fever while you are traveling or after you come back. Be sure to tell your doctor or nurse where you traveled, including any airports where you changed flights. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683784\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If the doctor or nurse thinks you have malaria, he or she will order a blood test to look for the parasite that causes it. There are several different types of the parasite. If you have malaria, the doctor needs to know which type you have so he or she can give the right treatment. A blood test can also show if malaria is causing other health problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683799\">",
"      <span class=\"h1\">",
"       How is malaria treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors give medicines to get rid of the parasite that causes malaria. There are several different medicines. Some people need to take more than 1.",
"     </p>",
"     <p>",
"      Most people can take pills by mouth, but people with severe malaria need treatment in the hospital. They get medicine through a thin tube called an &ldquo;IV&rdquo; that goes into a vein.",
"     </p>",
"     <p>",
"      After you start treatment, you will have blood tests every day for a few days. The tests are to make sure the medicine is working. If not, the doctor can give a different medicine.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683814\">",
"      <span class=\"h1\">",
"       Can malaria be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you travel to an area where malaria is common, taking medicine can help keep you from getting it. If you plan to travel outside the United States, tell your doctor or nurse as soon as possible. He or she can prescribe medicine if you need it. Take it exactly as the doctor tells you, or it might not work.",
"     </p>",
"     <p>",
"      Taking malaria medicine is important even if you travel to a place where you used to live and are going back to visit friends or relatives.",
"     </p>",
"     <p>",
"      You can also reduce your risk by preventing mosquito bites. To do this, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Stay inside at night &ndash; This means any time after sunset and before sunrise.",
"       </li>",
"       <li>",
"        Wear shoes, long-sleeved shirts, and long pants when you go outside.",
"       </li>",
"       <li>",
"        Wear bug spray or cream that contains DEET or a chemical called picaridin.",
"       </li>",
"       <li>",
"        Sleep in a building with good screens over the windows and doors or air conditioning. Or, you can sleep under a bed net treated with bug spray.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People can get malaria even while taking medicine to prevent it. If you get sick during or after travel to an area where malaria is common, and you were taking malaria medicine, see a doctor or nurse. Be sure to tell him or her you traveled to an area that has malaria and that you were taking medicine.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683829\">",
"      <span class=\"h1\">",
"       What if I am pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pregnant women have a higher risk of getting malaria than other people, and they can get much sicker. Malaria can cause the following problems:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A miscarriage &ndash; This is when a pregnancy ends on its own before a woman has been pregnant for 20 weeks.",
"       </li>",
"       <li>",
"        A baby that is born too small, too early, or infected with malaria",
"       </li>",
"       <li>",
"        Death of the mother or baby &ndash; The baby could die before or after birth. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If possible, pregnant women should avoid areas where malaria is common until about 2 months after the baby is born. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H71683844\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?32/39/33395?source=see_link\">",
