" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Classification of leprosy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 328px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Diagram representing the different clinical classifications of leprosy using both the World Health Organization and the Ridley-Jopling system. The increase in number of acid-fast bacilli and defects in cell-mediated immunity are represented in the continuum from paucibacillary (PB) to multibacillary (MB) disease.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Jacobson, R, and Krahenbuhl, JL. Leprosy. Lancet 1999; 353:655.",
"    </div>",
