var title_f3_47_3836="Staging of HL in pregnancy";
var content_f3_47_3836=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F81526&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F81526&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Staging studies in pregnant women with Hodgkin lymphoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History and physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Blood tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Complete blood count with differential",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Erythrocyte sedimentation rate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum creatinine concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Liver enzymes, including LDH and alkaline phosphatase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HIV serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Evaluation for supradiaphragmatic disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Single posterior/anterior view chest x-ray with adequate abdominal shielding",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Magnetic resonance imaging (if abnormalities seen on chest x-ray)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Computerized tomography (if MRI not available)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Evaluation for intraabdominal disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Magnetic resonance imaging",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ultrasound (if MRI not available)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Computerized tomography (if MRI and ultrasound not available)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Bone marrow biopsy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A unilateral bone marrow biopsy should be performed for patients with B symptoms; clinical stage IIB to IV disease; and for patients with anemia, leukopenia, or thrombocytopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Not indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gallium scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        PET scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone scan",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
